/*Table structure for table `ygt_category_bak` */

DROP TABLE IF EXISTS `ygt_category_bak`;

CREATE TABLE `ygt_category_bak` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'id 自增编号',
  `title` char(100) NOT NULL COMMENT '分类名称',
  `type` char(100) NOT NULL COMMENT '所属哪个选项，例如彩印工艺-添加剂 ‘colour_printing_additive’',
  `remark` text NOT NULL COMMENT '备注信息',
  `created_at` int(10) NOT NULL COMMENT 'laravel框架默认的创建时间',
  `updated_at` int(10) NOT NULL COMMENT 'laravel框架默认的修改时间',
  `delete_at` int(10) NOT NULL COMMENT 'laravel框架默认的删除时间（软删除）',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='分类表-订单创建中涉及到的分类选择都存在这张表中';

