/*Table structure for table `ygt_department` */

DROP TABLE IF EXISTS `ygt_department`;

CREATE TABLE `ygt_department` (
  `id` smallint(6) unsigned NOT NULL AUTO_INCREMENT COMMENT '部门表',
  `pid` smallint(6) NOT NULL DEFAULT '0',
  `privilege_id` smallint(6) NOT NULL COMMENT '权限表id',
  `title` varchar(30) NOT NULL DEFAULT '',
  `status` tinyint(4) NOT NULL DEFAULT '1',
  `updated_at` int(11) DEFAULT NULL,
  `created_at` int(11) DEFAULT NULL,
  `deleted_at` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;

