/*Table structure for table `ygt_message` */

DROP TABLE IF EXISTS `ygt_message`;

CREATE TABLE `ygt_message` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `type` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '0默认 1订单 2产品',
  `type_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT 'type关联对应表id 0表示没有关联',
  `title` varchar(100) NOT NULL DEFAULT '' COMMENT '消息标题或订单号',
  `permission_id` smallint(6) unsigned NOT NULL DEFAULT '0' COMMENT '权限id',
  `content` text NOT NULL COMMENT '消息详情rnrn表示换行',
  `status` tinyint(1) unsigned zerofill NOT NULL DEFAULT '1' COMMENT '1正常',
  `updated_at` int(11) DEFAULT NULL,
  `created_at` int(11) DEFAULT NULL,
  `deleted_at` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
