/*Table structure for table `ygt_order` */

DROP TABLE IF EXISTS `ygt_order`;

CREATE TABLE `ygt_order` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'id 自增编号',
  `order_type` int(10) DEFAULT NULL,
  `order_title` char(100) DEFAULT NULL COMMENT '订单号/生产单号',
  `contract_number` char(100) DEFAULT NULL COMMENT '合同编号',
  `customer_name` char(100) DEFAULT NULL COMMENT '客户名称',
  `product_name` char(100) DEFAULT NULL COMMENT '产品名称',
  `product_num` char(100) DEFAULT NULL COMMENT '产品数量',
  `unit` char(100) DEFAULT NULL COMMENT '数量单位',
  `grammage` char(100) DEFAULT NULL COMMENT '克数',
  `chip_specification_length` char(100) DEFAULT NULL COMMENT '片料规格',
  `chip_specification_width` char(100) DEFAULT NULL COMMENT '片料规格-宽',
  `finished_specification` char(100) DEFAULT NULL COMMENT '成品规格',
  `finished_weight` char(100) DEFAULT NULL COMMENT '成品重量',
  `finished_date` char(100) DEFAULT NULL COMMENT '交货日期',
  `created_at` int(10) DEFAULT NULL COMMENT 'laravel框架默认的创建时间',
  `updated_at` int(10) DEFAULT NULL COMMENT 'laravel框架默认的修改时间',
  `deleted_at` int(10) DEFAULT NULL COMMENT 'laravel框架默认的删除时间（软删除）',
  `weaving_type` char(100) DEFAULT NULL COMMENT '织布类型',
  `plate_numbering` char(100) DEFAULT NULL COMMENT '印版编号',
  `plate_position` char(100) DEFAULT NULL COMMENT '印版位置',
  `plate_modification` char(100) DEFAULT NULL COMMENT '印版修改',
  `public_plate` char(100) DEFAULT NULL COMMENT '公用印版',
  `is_priority` tinyint(3) DEFAULT NULL COMMENT '是否优先',
  `enterprise_icon` char(255) DEFAULT NULL COMMENT '企业图标(图片地址id)',
  `production_case_diagram` text COMMENT '生产实例图,图片地址id（可能多个）',
  `status` tinyint(3) DEFAULT NULL COMMENT '订单状态 1-待接单 2-生产中 3-已完成',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=39 DEFAULT CHARSET=utf8 COMMENT='订单-基础信息表';

