/*Table structure for table `ygt_user_token` */

DROP TABLE IF EXISTS `ygt_user_token`;

CREATE TABLE `ygt_user_token` (
  `user_id` int(11) unsigned NOT NULL DEFAULT '0',
  `imei` varchar(100) NOT NULL DEFAULT '' COMMENT '手机唯一的imei码',
  `salt` char(6) NOT NULL DEFAULT '' COMMENT '加密前缀',
