  `updated_at` int(11) DEFAULT NULL,
  `created_at` int(11) DEFAULT NULL,
  `deleted_at` int(11) DEFAULT NULL,
  `is_login` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '0退出状态 1登录状态'
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

